      <Button
        variant="contained"
        color="primary"
        className={classes.button}
        endIcon={<Icon>send</Icon>}
      >
        Send
      </Button>

      </div>

      </div>

        <Navigator></Navigator>
      </Grid>
      <Grid item xs={8}>
         <Filtros></Filtros> 
      </Grid>
    </Grid>
  );


}

export default Menu;
